def minOperations(nums1, nums2):
    if len(nums1) * 6 < len(nums2) and len(nums1) > len(nums2) * 6:
        return -1

    def countArray(nums):
        (counter, total) = ([0] * 6, 0)
        for num in nums:
            counter[num - 1] += 1
            total += num
        return (counter, total)
    (counter1, total1) = countArray(nums1)
    (counter2, total2) = countArray(nums2)
    if total1 < total2:
        (counter1, counter2) = (counter2, counter1)
        (total1, total2) = (total2, total1)
    (diff, operations, i) = (total1 - total2, 0, 5)
    while diff != 0:
        while i > -1 and counter1[i] == 0:
            i -= 1
        if i == -1:
            return -1
        dec = min(diff, i + 1)
        operations += (dec + 1) // 2
        if dec == i + 1:
            counter1[i] -= 1
        diff -= dec
    return operations

